Historisch-archäologische Abteilung: Ur- und Frühgeschichte des Kantons, Stadtgeschichte mit Modell des spätmittelalterlichen Sankt
Gallens; Eingebaute Zimmer des 16.-19. Jahrhunderts; Stickereiindustrie; Volkskunst; Kirchliche Kunst; Fahnen, u.a. aus der
Burgunderbeute, Waffen und Uniformen; Küche aus vorindustrieller Zeit; Apotheke; Coiffeursalon; Feuer und Licht; Kostüme;
Glasgemälde; Porzellan; Zinn; Musikinstrumente; Möbel; Spielzeug; St. Galler Figurentheater. Ethnologische Abteilung: Totenkult und
Schriftzeugnisse aus Altägypten; Masken und Skulpturen aus West- und Zentralafrika; Bronzearbeiten aus dem Königreich Benin;
kultische Objekte aus dem Pazifikraum; Indianer- und Inuitkulturen Nordamerikas; präkolumbianische Kulturen Mittel- und Südamerikas;
islamischer Kulturkreis von Nordafrika bis Mittelasien; Kulturkreis Indien, einschliesslich Zentralasien, Indochina und Indonesien;
Keramik und religiöse Kultur aus China; Kunstgewerbe, Nô-Masken und Figuren aus Japan.
Eröffnet: 1921

